import { baseUrl } from "./baseUrl";
import axios from "axios";

export const payment = async () => {
  try {
    const body = stuff
    const response = axios.post(`${baseUrl}/checkout`, body)
    const data = (await response).data;
    return data;
  } catch (error) {
    console.error(error.message);
  }
}
